import { styled } from '@mui/styles';

const PaginationWrapper = styled('div')({
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'flex-end',
  marginTop: '8px',
  overflow: 'hidden',
});

export default PaginationWrapper;
